elements.expression:
shape "square" fill="#777777" border="rgba(255,255,255,0)" borderWidth=0 maintainAspect=false
| render 
  containerStyle={containerStyle borderRadius="10px" border="3px solid #777777" opacity="0.5"}

image mode="contain" dataurl={
 asset {
  filters | essql 
  query="SELECT host,response
FROM kibana_sample_data_logs
WHERE host='artifacts.elastic.co'
ORDER BY timestamp DESC
LIMIT 1"|
    alterColumn "response" type="number" |
    getCell "response" |
   if {compare lt to=300} then="asset-44836321-fb5b-4025-96f9-0b6f9b3fa8ea" else={
    if {compare lt to=400} then="asset-4639754d-7ea7-4c9c-a6a9-f164b745c78a" else="asset-fcdaa8d9-2ae0-4543-b8f7-f30a7f31bbe7"
   }
  }
} | render

